043b\u0430\u0434\u0435\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1568_%D0%B3%D0%BE%D0%B4\" title=\"1568 \u0433\u043e\u0434\">1568<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%9B%D0%B0%D0%BD%D0%B3%D1%81%D0%B0%D0%B9%D0%B4%D0%B5\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041b\u0430\u043d\u0433\u0441\u0430\u0439\u0434\u0435\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041b\u0430\u043d\u0433\u0441\u0430\u0439\u0434\u0435<\/a>, \u0432\u044b\u043d\u0443\u0434\u0438\u0432\u0448\u0430\u044f \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0443 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F_%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82\" title=\"\u041c\u0430\u0440\u0438\u044f \u0421\u0442\u044e\u0430\u0440\u0442\">\u041c\u0430\u0440\u0438\u044e \u0421\u0442\u044e\u0430\u0440\u0442<\/a> \u0431\u0435\u0436\u0430\u0442\u044c \u0432 \u0410\u043d\u0433\u043b\u0438\u044e \u0438 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u0432\u0448\u0430\u044f \u0432 \u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438 \u0440\u0435\u0436\u0438\u043c \u0440\u0435\u0433\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%8E%D0%B0%D1%80%D1%82,_%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81,_1-%D0%B9_%D0%B3%D1%80%D0%B0%D1%84_%D0%9C%D0%BE%D1%80%D0%B5%D0%B9\" title=\"\u0421\u0442\u044e\u0430\u0440\u0442, \u0414\u0436\u0435\u0439\u043c\u0441, 1-\u0439 \u0433\u0440\u0430\u0444 \u041c\u043e\u0440\u0435\u0439\">\u0433\u0440\u0430\u0444\u0430 \u041c\u043e\u0440\u0435\u044f<\/a> \u043f\u0440\u0438 \u043c\u0430\u043b\u043e\u043b\u0435\u0442\u043d\u0435\u043c \u043a\u043e\u0440\u043e\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AF%D0%BA%D0%BE%D0%B2_I_(%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B8)\" title=\"\u042f\u043a\u043e\u0432 I (\u043a\u043e\u0440\u043e\u043b\u044c \u0410\u043d\u0433\u043b\u0438\u0438)\">\u0414\u0436\u0435\u0439\u043c\u0441\u0435 VI<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1598_%D0%B3%D0%BE%D0%B4\" title=\"1598 \u0433\u043e\u0434\">1598<\/a>&#160;\u2014 \u0431\u043b\u0430\u0433\u043e\u0441\u043b\u043e\u0432\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%93%D0%BE%D0%B4%D1%83%D0%BD%D0%BE%D0%B2\" class=\"mw-redirect\" title=\"\u0411\u043e\u0440\u0438\u0441 \u0413\u043e\u0434\u0443\u043d\u043e\u0432\">\u0411\u043e\u0440\u0438\u0441\u0430 \u0413\u043e\u0434\u0443\u043d\u043e\u0432\u0430<\/a> \u043d\u0430 \u0432\u0435\u043b\u0438\u043a\u043e\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e \u043c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u043e\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1619_%D0%B3%D0%BE%D0%B4\" title=\"1619 \u0433\u043e\u0434\">1619<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B0%D0%B3%D0%B0\" title=\"\u0413\u0430\u0430\u0433\u0430\">\u0413\u0430\u0430\u0433\u0435<\/a> \u043a\u0430\u0437\u043d\u0451\u043d \u0432\u0438\u0434\u043d\u044b\u0439 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 \u0434\u0435\u044f\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BB%D0%B4%D0%B5%D0%BD%D0%B1%D0%B0%D1%80%D0%BD%D0%B5%D0%B2%D0%B5%D0%BB%D1%82,_%D0%99%D0%BE%D1%85%D0%B0%D0%BD_%D0%B2%D0%B0%D0%BD\" title=\"\u041e\u043b\u0434\u0435\u043d\u0431\u0430\u0440\u043d\u0435\u0432\u0435\u043b\u0442, \u0419\u043e\u0445\u0430\u043d \u0432\u0430\u043d\">\u0419\u043e\u0445\u0430\u043d \u0432\u0430\u043d \u041e\u043b\u0434\u0435\u043d\u0431\u0430\u0440\u043d\u0435\u0432\u0435\u043b\u0442<\/a> \u043f\u043e \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044e \u0432 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0438\u0437\u043c\u0435\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1637_%D0%B3%D0%BE%D0%B4\" title=\"1637 \u0433\u043e\u0434\">1637<\/a>&#160;\u2014 \u043a\u0430\u0440\u0434\u0438\u043d\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D1%88%D0%B5%D0%BB%D1%8C%D1%91,_%D0%90%D1%80%D0%BC%D0%B0%D0%BD_%D0%96%D0%B0%D0%BD_%D0%B4%D1%8E_%D0%9F%D0%BB%D0%B5%D1%81%D1%81%D0%B8\" title=\"\u0420\u0438\u0448\u0435\u043b\u044c\u0451, \u0410\u0440\u043c\u0430\u043d \u0416\u0430\u043d \u0434\u044e \u041f\u043b\u0435\u0441\u0441\u0438\">\u0420\u0438\u0448\u0435\u043b\u044c\u0451<\/a>, \u043f\u0430\u043c\u044f\u0442\u0443\u044f \u043e \u0441\u0432\u043e\u0438\u0445 \u0432\u0440\u0430\u0433\u0430\u0445, \u043f\u0440\u0438\u043a\u0430\u0437\u0430\u043b \u0437\u0430\u043a\u0440\u0443\u0433\u043b\u0438\u0442\u044c \u0432\u0441\u0435 \u043a\u0438\u043d\u0436\u0430\u043b\u044b, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0438\u0441\u044c \u0437\u0430 \u0435\u0434\u043e\u0439 \u0434\u043b\u044f \u043d\u0430\u0440\u0435\u0437\u0430\u043d\u0438\u044f \u043c\u044f\u0441\u0430, \u0441\u043e\u0437\u0434\u0430\u0432 \u0442\u0430\u043a\u0438\u043c \u043e\u0431\u0440\u0430\u0437\u043e\u043c \u0441\u0442\u043e\u043b\u043e\u0432\u044b\u0439 \u043d\u043e\u0436 .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1641_%D0%B3%D0%BE%D0%B4\" title=\"1641 \u0433\u043e\u0434\">1641<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B3%D0%B0%D0%B4%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0421\u0435\u0433\u0430\u0434\u043e\u0440\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435\">\u041a\u0430\u0442\u0430\u043b\u043e\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a class=\"external text\" href=\"https:\/\/es.wikipedia.org\/wiki\/Batalla_de_Constant%C3%AD\">\u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438<\/a>&#160;(\u0438\u0441\u043f.).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1647_%D0%B3%D0%BE%D0%B4\" title=\"1647 \u0433\u043e\u0434\">1647<\/a>&#160;\u2014 \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 <a class=\"external text\" href=\"https:\/\/es.wikipedia.org\/wiki\/Terremoto_de_Santiago_de_1647\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f<\/a>&#160;(\u0438\u0441\u043f.) \u043f\u043e\u0447\u0442\u0438 \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0440\u0430\u0437\u0440\u0443\u0448\u0435\u043d \u0433\u043e\u0440\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D1%82%D1%8C%D1%8F%D0%B3%D0%BE\" title=\"\u0421\u0430\u043d\u0442\u044c\u044f\u0433\u043e\">\u0421\u0430\u043d\u0442\u044c\u044f\u0433\u043e<\/a>&#160;\u2014 \u0441\u0442\u043e\u043b\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB-%D0%BA%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE_%D0%A7%D0%B8%D0%BB%D0%B8\" title=\"\u0413\u0435\u043d\u0435\u0440\u0430\u043b-\u043a\u0430\u043f\u0438\u0442\u0430\u043d\u0441\u0442\u0432\u043e \u0427\u0438\u043b\u0438\">\u0413\u0435\u043d\u0435\u0440\u0430\u043b-\u043a\u0430\u043f\u0438\u0442\u0430\u043d\u0441\u0442\u0432\u0430 \u0427\u0438\u043b\u0438<\/a> (\u0431\u0443\u0434\u0443\u0449\u0430\u044f \u0441\u0442\u043e\u043b\u0438\u0446\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BB%D0%B8\" title=\"\u0427\u0438\u043b\u0438\">\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438 \u0427\u0438\u043b\u0438<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1667_%D0%B3%D0%BE%D0%B4\" title=\"1667 \u0433\u043e\u0434\">1667<\/a>&#160;\u2014 \u043d\u0430 \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u0431\u044b\u043b\u0438 \u043e\u0441\u0443\u0436\u0434\u0435\u043d\u044b \u0441\u0442\u0430\u0440\u043e\u043e\u0431\u0440\u044f\u0434\u0446\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1696_%D0%B3%D0%BE%D0%B4\" title=\"1696 \u0433\u043e\u0434\">1696<\/a>&#160;\u2014 \u0432\u043e\u0439\u0441\u043a\u0430 \u0438\u043c\u043f\u0435\u0440\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B8%D0%BD\" class=\"mw-redirect\" title=\"\u0426\u0438\u043d\">\u0426\u0438\u043d<\/a> \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%BB%D0%B4%D0%B0%D0%BD-%D0%91%D0%BE%D1%88%D0%BE%D0%B3%D1%82%D1%83\" title=\"\u0413\u0430\u043b\u0434\u0430\u043d-\u0411\u043e\u0448\u043e\u0433\u0442\u0443\">\u0413\u0430\u043b\u0434\u0430\u043d-\u0411\u043e\u0448\u043e\u0433\u0442\u0443<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BD%D0%B0_%D0%A2%D1%8D%D1%80%D1%8D%D0%BB%D0%B6%D0%B5_(1696)\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043d\u0430 \u0422\u044d\u0440\u044d\u043b\u0436\u0435 (1696)\">\u0431\u0438\u0442\u0432\u0435 \u043d\u0430 \u0422\u044d\u0440\u044d\u043b\u0436\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1754_%D0%B3%D0%BE%D0%B4\" title=\"1754 \u0433\u043e\u0434\">1754<\/a>&#160;\u2014 \u0432\u044b\u0448\u0435\u043b \u0443\u043a\u0430\u0437 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u0440\u0438\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D0%B8%D0%B7%D0%B0%D0%B2%D0%B5%D1%82%D0%B0_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u0430 \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u0430\">\u0415\u043b\u0438\u0437\u0430\u0432\u0435\u0442\u044b \u041f\u0435\u0442\u0440\u043e\u0432\u043d\u044b<\/a> \u043e\u0431 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0431\u0430\u043d\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1783_%D0%B3%D0%BE%D0%B4\" title=\"1783 \u0433\u043e\u0434\">1783<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B7%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%84%D0%BB%D0%BE%D1%82%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0437\u043e\u0432\u0441\u043a\u0430\u044f \u0432\u043e\u0435\u043d\u043d\u0430\u044f \u0444\u043b\u043e\u0442\u0438\u043b\u0438\u044f\">\u0410\u0437\u043e\u0432\u0441\u043a\u0430\u044f \u0444\u043b\u043e\u0442\u0438\u043b\u0438\u044f<\/a> \u0432\u043e\u0448\u043b\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D1%83%D1%85%D1%82%D0%B0\" title=\"\u0421\u0435\u0432\u0430\u0441\u0442\u043e\u043f\u043e\u043b\u044c\u0441\u043a\u0430\u044f \u0431\u0443\u0445\u0442\u0430\">\u0410\u0445\u0442\u0438\u0430\u0440\u0441\u043a\u0443\u044e \u0431\u0443\u0445\u0442\u0443<\/a>, \u0447\u0442\u043e \u043e\u0437\u043d\u0430\u0447\u0430\u043b\u043e \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%80%D0%BD%D0%BE%D0%BC%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%84%D0%BB%D0%BE%D1%82_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" class=\"mw-redirect\" title=\"\u0427\u0435\u0440\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438\">\u0427\u0435\u0440\u043d\u043e\u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1777_%D0%B3%D0%BE%D0%B4\" title=\"1777 \u0433\u043e\u0434\">1777<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u0441\u043a\u043e\u0439 \u0431\u0438\u0431\u043b\u0438\u043e\u0442\u0435\u043a\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B0\" title=\"\u0412\u0435\u043d\u0430\">\u0412\u0435\u043d\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1779_%D0%B3%D0%BE%D0%B4\" title=\"1779 \u0433\u043e\u0434\">1779<\/a>&#160;\u2014 \u043f\u043e\u0434\u043f\u0438\u0441\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%88%D0%B5%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80\" title=\"\u0422\u0435\u0448\u0435\u043d\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440\">\u0422\u0435\u0448\u0435\u043d\u0441\u043a\u0438\u0439 \u0434\u043e\u0433\u043e\u0432\u043e\u0440<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%B1%D0%B0%D0%B2%D0%B0%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u0431\u0430\u0432\u0430\u0440\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e\">\u0432\u043e\u0439\u043d\u0443 \u0437\u0430 \u0411\u0430\u0432\u0430\u0440\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1787_%D0%B3%D0%BE%D0%B4\" title=\"1787 \u0433\u043e\u0434\">1787<\/a>&#160;\u2014 \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u0435\u043c\u044b\u0439 \u043a\u0430\u043f\u0438\u0442\u0430\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%BB%D0%B8%D0%BF,_%D0%90%D1%80%D1%82%D1%83%D1%80\" title=\"\u0424\u0438\u043b\u043b\u0438\u043f, \u0410\u0440\u0442\u0443\u0440\">\u0410\u0440\u0442\u0443\u0440\u043e\u043c \u0424\u0438\u043b\u043b\u0438\u043f\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_%D1%84%D0%BB%D0%BE%D1%82\" title=\"\u041f\u0435\u0440\u0432\u044b\u0439 \u0444\u043b\u043e\u0442\">\u041f\u0435\u0440\u0432\u044b\u0439 \u0444\u043b\u043e\u0442<\/a> \u0441 \u043a\u0430\u0442\u043e\u0440\u0436\u043d\u0438\u043a\u0430\u043c\u0438 \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82%D1%81%D0%BC%D1%83%D1%82_(%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F)\" title=\"\u041f\u043e\u0440\u0442\u0441\u043c\u0443\u0442 (\u0410\u043d\u0433\u043b\u0438\u044f)\">\u041f\u043e\u0440\u0442\u0441\u043c\u0443\u0442\u0430<\/a>, \u0447\u0442\u043e\u0431\u044b \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u044c \u043f\u0435\u0440\u0432\u0443\u044e \u043a\u043e\u043b\u043e\u043d\u0438\u044e \u043a\u0430\u0442\u043e\u0440\u0436\u043d\u0438\u043a\u043e\u0432 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0430\u043b\u0438\u0438<\/a>.<\/li><\/ul><h3>XIX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1805_%D0%B3%D0%BE%D0%B4\" title=\"1805 \u0433\u043e\u0434\">1805<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%B1%D0%B5%D1%80%D0%B1%D0%B5%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u0431\u0435\u0440\u0431\u0435\u0440\u0438\u0439\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u043e\u0439 \u0431\u0435\u0440\u0431\u0435\u0440\u0438\u0439\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Battle_of_Derne\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0414\u0435\u0440\u043d\u0435<\/a> &#160;(\u0430\u043d\u0433\u043b.).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1829_%D0%B3%D0%BE%D0%B4\" title=\"1829 \u0433\u043e\u0434\">1829<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0448\u043a\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041f\u0443\u0448\u043a\u0438\u043d<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u0438\u0437 \u041c\u043e\u0441\u043a\u0432\u044b \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B2%D0%BA%D0%B0%D0%B7\" title=\"\u041a\u0430\u0432\u043a\u0430\u0437\">\u041a\u0430\u0432\u043a\u0430\u0437<\/a> \u0432 \u0434\u0435\u0439\u0441\u0442\u0432\u0443\u044e\u0449\u0443\u044e \u0430\u0440\u043c\u0438\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0448\u043a\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u041f\u0443\u0448\u043a\u0438\u043d<\/a> \u043f\u0440\u043e\u0441\u0438\u0442 \u0440\u0443\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D0%BD%D1%87%D0%B0%D1%80%D0%BE%D0%B2%D0%B0,_%D0%9D%D0%B0%D1%82%D0%B0%D0%BB%D1%8C%D1%8F_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%BD%D0%B0\" title=\"\u0413\u043e\u043d\u0447\u0430\u0440\u043e\u0432\u0430, \u041d\u0430\u0442\u0430\u043b\u044c\u044f \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u043d\u0430\">\u041d\u0430\u0442\u0430\u043b\u044c\u0438 \u0413\u043e\u043d\u0447\u0430\u0440\u043e\u0432\u043e\u0439<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830_%D0%B3%D0%BE%D0%B4\" title=\"1830 \u0433\u043e\u0434\">1830<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BA%D0%B2%D0%B0%D0%B4%D0%BE%D1%80\" title=\"\u042d\u043a\u0432\u0430\u0434\u043e\u0440\">\u042d\u043a\u0432\u0430\u0434\u043e\u0440<\/a> \u0432\u044b\u0448\u0435\u043b \u0438\u0437 \u0441\u043e\u0441\u0442\u0430\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D0%9A%D0%BE%D0%BB%D1%83%D0%BC%D0%B1%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u0430\u044f \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0439 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u0438<\/a> \u0438 \u043e\u0431\u044a\u044f\u0432\u0438\u043b \u0441\u0435\u0431\u044f \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1836_%D0%B3%D0%BE%D0%B4\" title=\"1836 \u0433\u043e\u0434\">1836<\/a> \u2014 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D