40 \u0438 \u0432\u0435\u0441\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1846_%D0%B3%D0%BE%D0%B4\" title=\"1846 \u0433\u043e\u0434\">1846<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0444\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u043e \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B0%D0%BD%D0%BE-%D0%BC%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u043e-\u043c\u0435\u043a\u0441\u0438\u043a\u0430\u043d\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0432\u043e\u0439\u043d\u0443<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BA%D1%81%D0%B8%D0%BA%D0%B0\" title=\"\u041c\u0435\u043a\u0441\u0438\u043a\u0430\">\u041c\u0435\u043a\u0441\u0438\u043a\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1857_%D0%B3%D0%BE%D0%B4\" title=\"1857 \u0433\u043e\u0434\">1857<\/a>&#160;\u2014 \u0438\u0437-\u0437\u0430 \u043d\u0435\u043b\u0435\u043f\u044b\u0445 \u0441\u043b\u0443\u0445\u043e\u0432 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0443\u043f\u0430\u0434\u0443\u0442 \u0432\u044b\u0441\u043e\u043a\u0438\u0435 \u0434\u043e\u043c\u0430, \u043f\u0430\u0440\u0438\u0436\u0430\u043d\u0435 \u0432 \u043f\u0430\u043d\u0438\u043a\u0435 \u043f\u043e\u043a\u0438\u043d\u0443\u043b\u0438 \u0433\u043e\u0440\u043e\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1865_%D0%B3%D0%BE%D0%B4\" title=\"1865 \u0433\u043e\u0434\">1865<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%98._%D0%98._%D0%9C%D0%B5%D1%87%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D0%B0\" title=\"\u041e\u0434\u0435\u0441\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c\u0435\u043d\u0438 \u0418. \u0418. \u041c\u0435\u0447\u043d\u0438\u043a\u043e\u0432\u0430\">\u041d\u043e\u0432\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%B0\" title=\"\u041e\u0434\u0435\u0441\u0441\u0430\">\u041e\u0434\u0435\u0441\u0441\u0435<\/a> (\u0441\u0435\u0439\u0447\u0430\u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%B4%D0%B5%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%98._%D0%98._%D0%9C%D0%B5%D1%87%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2%D0%B0\" title=\"\u041e\u0434\u0435\u0441\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c\u0435\u043d\u0438 \u0418. \u0418. \u041c\u0435\u0447\u043d\u0438\u043a\u043e\u0432\u0430\">\u041e\u0434\u0435\u0441\u0441\u043a\u0438\u0439 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u044b\u0439 \u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442 \u0438\u043c\u0435\u043d\u0438 \u0418. \u0418. \u041c\u0435\u0447\u043d\u0438\u043a\u043e\u0432\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1871_%D0%B3%D0%BE%D0%B4\" title=\"1871 \u0433\u043e\u0434\">1871<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D1%82%D0%B8%D0%BA%D0%B0%D0%BD\" title=\"\u0412\u0430\u0442\u0438\u043a\u0430\u043d\">\u0412\u0430\u0442\u0438\u043a\u0430\u043d<\/a> \u0432\u043a\u043b\u044e\u0447\u0451\u043d \u0432 \u0418\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u043e\u0435 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e, \u0430 \u0441\u0443\u0432\u0435\u0440\u0435\u043d\u0438\u0442\u0435\u0442 \u043f\u0430\u043f\u044b \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d \u0434\u0432\u043e\u0440\u0446\u0430\u043c\u0438 \u0412\u0430\u0442\u0438\u043a\u0430\u043d\u0430, \u0440\u0438\u043c\u0441\u043a\u043e\u0439 \u043b\u0430\u0442\u0435\u0440\u0430\u043d\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u043e\u0432\u044c\u044e \u0438 \u0437\u0430\u0433\u043e\u0440\u043e\u0434\u043d\u043e\u0439 \u043f\u0430\u043f\u0441\u043a\u043e\u0439 \u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0446\u0438\u0435\u0439. \u041a \u0434\u0432\u043e\u0440\u0446\u0430\u043c, \u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u0434\u043e\u0432\u043e\u043b\u044c\u043d\u043e \u043e\u0431\u0448\u0438\u0440\u043d\u044b, \u043e\u0442\u043d\u043e\u0441\u0438\u043b\u0438\u0441\u044c \u0442\u0430\u043a\u0436\u0435 \u0438 \u043f\u0440\u0435\u043a\u0440\u0430\u0441\u043d\u044b\u0435 \u0432\u0430\u0442\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0435 \u0441\u0430\u0434\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1888_%D0%B3%D0%BE%D0%B4\" title=\"1888 \u0433\u043e\u0434\">1888<\/a>&#160;\u2014 \u043e\u0442\u043c\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B1%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0420\u0430\u0431\u0441\u0442\u0432\u043e\">\u0440\u0430\u0431\u0441\u0442\u0432\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f\">\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895_%D0%B3%D0%BE%D0%B4\" title=\"1895 \u0433\u043e\u0434\">1895<\/a><ul><li>\u041e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 \u0444\u0435\u0434\u0435\u0440\u0430\u0446\u0438\u044f \u0444\u0443\u0442\u0431\u043e\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B8%D0%BB%D0%B8\" title=\"\u0427\u0438\u043b\u0438\">\u0427\u0438\u043b\u0438<\/a>.<\/li><li>\u0423\u043a\u0430\u0437\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f II<\/a> \u043d\u0430 \u0432\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438 \u043f\u0440\u0438\u043d\u0438\u043c\u0430\u044e\u0442\u0441\u044f \u0441\u043e\u043b\u0434\u0430\u0442\u0441\u043a\u0430\u044f \u0438 \u043e\u0444\u0438\u0446\u0435\u0440\u0441\u043a\u0430\u044f \u043c\u043e\u0434\u0438\u0444\u0438\u043a\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8C%D0%B2%D0%B5%D1%80_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D1%8B_%D0%9D%D0%B0%D0%B3%D0%B0%D0%BD%D0%B0\" title=\"\u0420\u0435\u0432\u043e\u043b\u044c\u0432\u0435\u0440 \u0441\u0438\u0441\u0442\u0435\u043c\u044b \u041d\u0430\u0433\u0430\u043d\u0430\">\u0440\u0435\u0432\u043e\u043b\u044c\u0432\u0435\u0440\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u044b \u041d\u0430\u0433\u0430\u043d\u0430<\/a>.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u0441\u0433\u043e\u0440\u0435\u043b\u0430 \u043b\u0430\u0431\u043e\u0440\u0430\u0442\u043e\u0440\u0438\u044f \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0430\u0442\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B5%D1%81%D0%BB%D0%B0,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0\" title=\"\u0422\u0435\u0441\u043b\u0430, \u041d\u0438\u043a\u043e\u043b\u0430\">\u041d\u0438\u043a\u043e\u043b\u044b \u0422\u0435\u0441\u043b\u044b<\/a>. \u0412 \u043e\u0433\u043d\u0435 \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0436\u0443\u0440\u043d\u0430\u043b\u044b \u0441 \u0437\u0430\u043f\u0438\u0441\u044f\u043c\u0438 \u043c\u043d\u043e\u0433\u0438\u0445 \u044d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u043e\u0432 \u0438 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u0439.<\/li><\/ul><\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/V_%D1%81%D1%8A%D0%B5%D0%B7%D0%B4_%D0%A0%D0%A1%D0%94%D0%A0%D0%9F\" title=\"V \u0441\u044a\u0435\u0437\u0434 \u0420\u0421\u0414\u0420\u041f\">V \u0441\u044a\u0435\u0437\u0434 \u0420\u0421\u0414\u0420\u041f<\/a>, \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0432\u0448\u0438\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1_%D0%B8%D1%8E%D0%BD%D1%8F\" title=\"1 \u0438\u044e\u043d\u044f\">1 \u0438\u044e\u043d\u044f<\/a> \u0438 \u043f\u043e\u043b\u0443\u0447\u0438\u0432\u0448\u0438\u0439 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u041b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u043e\u0433\u043e \u0421\u044a\u0435\u0437\u0434\u0430. \u0421\u0440\u0435\u0434\u0438 \u0434\u0435\u043b\u0435\u0433\u0430\u0442\u043e\u0432&#160;\u2014 \u041b\u0435\u043d\u0438\u043d, \u0421\u0442\u0430\u043b\u0438\u043d, \u0422\u0440\u043e\u0446\u043a\u0438\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913_%D0%B3%D0%BE%D0%B4\" title=\"1913 \u0433\u043e\u0434\">1913<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 4-\u043c\u043e\u0442\u043e\u0440\u043d\u044b\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%B8%D1%82%D1%8F%D0%B7%D1%8C_(%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82)\" title=\"\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0432\u0438\u0442\u044f\u0437\u044c (\u0441\u0430\u043c\u043e\u043b\u0451\u0442)\">\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0432\u0438\u0442\u044f\u0437\u044c<\/a>\u00bb (\u043e\u0431\u0449\u0430\u044f \u043c\u0430\u0441\u0441\u0430 \u043e\u043a\u043e\u043b\u043e 5 000 \u043a\u0433), \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043d\u044b\u0439 \u043d\u0430 \u0420\u0443\u0441\u0441\u043a\u043e-\u0411\u0430\u043b\u0442\u0438\u0439\u0441\u043a\u043e\u043c \u0437\u0430\u0432\u043e\u0434\u0435 \u043f\u043e \u043f\u0440\u043e\u0435\u043a\u0442\u0443 \u0430\u0432\u0438\u0430\u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0442\u043e\u0440\u0430 \u0418.&#160;\u0418.&#160;\u0421\u0438\u043a\u043e\u0440\u0441\u043a\u043e\u0433\u043e. \u041d\u0430 \u0435\u0433\u043e \u0431\u0430\u0437\u0435 \u0432\u0441\u043a\u043e\u0440\u0435 \u0431\u044b\u043b \u0441\u043e\u0437\u0434\u0430\u043d \u0431\u043e\u043b\u0435\u0435 \u0441\u043e\u0432\u0435\u0440\u0448\u0435\u043d\u043d\u044b\u0439 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u0433\u0438\u0433\u0430\u043d\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BB%D1%8C%D1%8F_%D0%9C%D1%83%D1%80%D0%BE%D0%BC%D0%B5%D1%86_(%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82)\" title=\"\u0418\u043b\u044c\u044f \u041c\u0443\u0440\u043e\u043c\u0435\u0446 (\u0441\u0430\u043c\u043e\u043b\u0451\u0442)\">\u0418\u043b\u044c\u044f \u041c\u0443\u0440\u043e\u043c\u0435\u0446<\/a>\u00bb, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0441\u044f \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a><ul><li>\u0414\u0435\u043a\u0440\u0435\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%A6%D0%B5%D0%BD%D1%82%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%98%D1%81%D0%BF%D0%BE%D0%BB%D0%BD%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%9A%D0%BE%D0%BC%D0%B8%D1%82%D0%B5%D1%82\" class=\"mw-redirect\" title=\"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0426\u0435\u043d\u0442\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0418\u0441\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u041a\u043e\u043c\u0438\u0442\u0435\u0442\">\u0412\u0426\u0418\u041a<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A0%D0%A1%D0%A4%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432 \u0420\u0421\u0424\u0421\u0420\">\u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c\u0430<\/a> \u00ab\u041e \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0438 \u043d\u0430\u0440\u043e\u0434\u043d\u043e\u043c\u0443 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u0443 \u0447\u0440\u0435\u0437\u0432\u044b\u0447\u0430\u0439\u043d\u044b\u0445 \u043f\u043e\u043b\u043d\u043e\u043c\u043e\u0447\u0438\u0439 \u043f\u043e \u0431\u043e\u0440\u044c\u0431\u0435 \u0441 \u0434\u0435\u0440\u0435\u0432\u0435\u043d\u0441\u043a\u043e\u0439 \u0431\u0443\u0440\u0436\u0443\u0430\u0437\u0438\u0435\u0439, \u0443\u043a\u0440\u044b\u0432\u0430\u044e\u0449\u0435\u0439 \u0445\u043b\u0435\u0431\u043d\u044b\u0435 \u0437\u0430\u043f\u0430\u0441\u044b \u0438 \u0441\u043f\u0435\u043a\u0443\u043b\u0438\u0440\u0443\u044e\u0449\u0435\u0439 \u0438\u043c\u0438\u00bb.<\/li><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B5%D0%B4%D0%B8%D0%BD%D1%91%D0%BD%D0%BD%D1%8B%D0%B5_%D0%A8%D1%82%D0%B0%D1%82%D1%8B_%D0%90%D0%BC%D0%B5%D1%80%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0435 \u0428\u0442\u0430\u0442\u044b \u0410\u043c\u0435\u0440\u0438\u043a\u0438\">\u0421\u0428\u0410<\/a> \u043d\u0430\u043f\u0435\u0447\u0430\u0442\u0430\u043d\u044b \u043f\u043e\u0447\u0442\u043e\u0432\u044b\u0435 \u043c\u0430\u0440\u043a\u0438 \u0441 \u043f\u0435\u0440\u0435\u0432\u0451\u0440\u043d\u0443\u0442\u044b\u043c \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0435\u043c \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u043e\u0432 (\u0441\u0442\u0430\u0432\u0448\u0438\u0435 \u043a\u043e\u043b\u043b\u0435\u043a\u0446\u0438\u043e\u043d\u043d\u043e\u0439 \u0440\u0435\u0434\u043a\u043e\u0441\u0442\u044c\u044e).<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e \u043d\u0430\u0441