ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%85%D0%B0%D1%80\" title=\"\u0421\u0430\u0445\u0430\u0440\">\u0441\u0430\u0445\u0430\u0440<\/a> \u043d\u0430\u0437\u0432\u0430\u043d \u0433\u043b\u0430\u0432\u043d\u043e\u0439 \u043f\u0440\u0438\u0447\u0438\u043d\u043e\u0439 \u0431\u043e\u043b\u0435\u0437\u043d\u0438 \u0437\u0443\u0431\u043e\u0432, \u0434\u043b\u044f \u0438\u0437\u0431\u0435\u0436\u0430\u043d\u0438\u044f \u043f\u0430\u0433\u0443\u0431\u043d\u044b\u0445 \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0439 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u043e\u0432\u0430\u043b\u043e\u0441\u044c \u043f\u043e\u0441\u043b\u0435 \u0441\u043b\u0430\u0434\u043e\u0441\u0442\u0435\u0439 \u043f\u0438\u0442\u044c \u0441\u0443\u0445\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D0%BC%D0%BF%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B5\" title=\"\u0428\u0430\u043c\u043f\u0430\u043d\u0441\u043a\u043e\u0435\">\u0448\u0430\u043c\u043f\u0430\u043d\u0441\u043a\u043e\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c \u0438\u0437\u0434\u0430\u043b \u0434\u0435\u043a\u0440\u0435\u0442 \u043e\u0431 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438 \u0434\u043e\u043c\u043e\u0432 \u043e\u0442\u0434\u044b\u0445\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442 III \u0441\u044a\u0435\u0437\u0434 \u0421\u043e\u0432\u0435\u0442\u043e\u0432 \u0421\u0421\u0421\u0420.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1927_%D0%B3%D0%BE%D0%B4\" title=\"1927 \u0433\u043e\u0434\">1927<\/a><ul><li>\u0412 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0451\u043b \u043a\u0440\u0430\u0445 \u0444\u0438\u043d\u0430\u043d\u0441\u043e\u0