0432\u0438\u0440\u0441\u043a\u0438\u0439.<\/li><li>\u0410\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D0%B4%D0%B5%D0%BB%D1%8C%D1%88%D1%82%D0%B0%D0%BC,_%D0%9E%D1%81%D0%B8%D0%BF_%D0%AD%D0%BC%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u043d\u0434\u0435\u043b\u044c\u0448\u0442\u0430\u043c, \u041e\u0441\u0438\u043f \u042d\u043c\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u041e\u0441\u0438\u043f \u041c\u0430\u043d\u0434\u0435\u043b\u044c\u0448\u0442\u0430\u043c<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 \u043f\u0438\u0441\u044c\u043c\u043e \u0426\u041a \u0412\u041a\u041f(\u0431) \u043e \u043f\u0440\u043e\u0432\u0435\u0440\u043a\u0435 \u043f\u0430\u0440\u0442\u0438\u0439\u043d\u044b\u0445 \u0434\u043e\u043a\u0443\u043c\u0435\u043d\u0442\u043e\u0432, \u0443\u0441\u0438\u043b\u0438\u0432\u0448\u0435\u0435 \u043d\u0430\u0447\u0430\u0432\u0448\u0438\u0435\u0441\u044f \u0440\u0435\u043f\u0440\u0435\u0441\u0441\u0438\u0438 \u043f\u0440\u043e\u0442\u0438\u0432 \u00ab\u0432\u0440\u0430\u0433\u043e\u0432 \u043d\u0430\u0440\u043e\u0434\u0430\u00bb, \u043f\u043e\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0432\u0448\u0438\u0435 \u0437\u0430 \u0443\u0431\u0438\u0439\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%BE%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9C%D0%B8%D1%80%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0438\u0440\u043e\u0432, \u0421\u0435\u0440\u0433\u0435\u0439 \u041c\u0438\u0440\u043e\u043d\u043e\u0432\u0438\u0447\">\u0421.&#160;\u041c.&#160;\u041a\u0438\u0440\u043e\u0432\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1940_%D0%B3%D0%BE%D0%B4\" title=\"1940 \u0433\u043e\u0434\">1940<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC%D0%