430\u0442\u044c\u044f\u043d\u0430 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u043d\u0430\">\u0422\u0430\u043d\u044f \u0421\u0430\u0432\u0438\u0447\u0435\u0432\u0430<\/a> \u0441\u0434\u0435\u043b\u0430\u043b\u0430 \u0432 \u0441\u0432\u043e\u0451\u043c \u0434\u043d\u0435\u0432\u043d\u0438\u043a\u0435 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0435 \u0437\u0430\u043f\u0438\u0441\u0438: \u00ab\u041c\u0430\u043c\u0430 \u0432 13 \u043c\u0430\u044f \u0432 7-30 \u0443\u0442\u0440\u0430\u00bb, \u00ab\u0421\u0430\u0432\u0438\u0447\u0435\u0432\u044b \u0443\u043c\u0435\u0440\u043b\u0438\u00bb, \u00ab\u0423\u043c\u0435\u0440\u043b\u0438 \u0432\u0441\u0435\u00bb, \u00ab\u041e\u0441\u0442\u0430\u043b\u0430\u0441\u044c \u043e\u0434\u043d\u0430 \u0422\u0430\u043d\u044f\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1949_%D0%B3%D0%BE%D0%B4\" title=\"1949 \u0433\u043e\u0434\">1949<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%98%D0%BB-12_%D0%BF%D0%BE%D0%B4_%D0%9D%D0%BE%D0%B2%D0%BE%D1%81%D0%B8%D0%B1%D0%B8%D1%80%D1%81%D0%BA%D0%BE%D0%BC_(1949)\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-12 \u043f\u043e\u0434 \u041d\u043e\u0432\u043e\u0441\u0438\u0431\u0438\u0440\u0441\u043a\u043e\u043c (1949)\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0418\u043b-12 \u043f\u043e\u0434 \u041d\u043e\u0432\u043e\u0441\u0438\u0431\u0438\u0440\u0441\u043a\u043e\u043c<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 25 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 \u0432 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BB%D1%8C%D0%B2%D0%B5%D1%80%D1%81%D1%82%D0%BE%D1%83%D0%BD_(%D1%82%D1%80%D0%B0%D1%81%D1%81%D0%B0)\" title=\"\u0421\u0438\u043b\u044c\u0432\u0435\u0440\u0441\u0442\u043e\u0443\u043d (\u0442\u0440\u0430\u0441\u0441\u0430)\">\u0421\u0438\u043b\u044c\u0432\u0435\u0440\u0441\u0442\u043e\u0443\u043d\u0435<\/a> \u043f\u0440\u043e\u0448\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0433\u043e\u043d\u043a\u0430 \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0430 \u00ab\u0424\u043e\u0440\u043c\u0443\u043b\u044b-1\u00bb. \u041f\u043e\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u0435\u043c \u0441\u0442\u0430\u043b \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u0433\u043e\u043d\u0449\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D1%80%D0%B8%D0%BD%D0%B0,_%D0%94%D0%B6%D1%83%D0%B7%D0%B5%D0%BF%D0%BF%D0%B5\" title=\"\u0424\u0430\u0440\u0438\u043d\u0430, \u0414\u0436\u0443\u0437\u0435\u043f\u043f\u0435\">\u0414\u0436\u0443\u0437\u0435\u043f\u043f\u0435 \u0424\u0430\u0440\u0438\u043d\u0430<\/a> (Giuseppe Farina) (\u00ab\u0410\u043b\u044c\u0444\u0430-\u0420\u043e\u043c\u0435\u043e\u00bb), \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u043e \u0438\u0442\u043e\u0433\u0430\u043c \u0441\u0435\u0437\u043e\u043d\u0430 \u0441\u0442\u0430\u043b \u0438 \u043f\u0435\u0440\u0432\u044b\u043c \u0447\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u043c \u00ab\u0424\u043e\u0440\u043c\u0443\u043b\u044b-1\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954<\/a>&#160;\u2014 \u0441\u0432\u043e\u0439 \u043f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u044d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u0430\u043b\u044c\u043d\u044b\u0439 \u0432\u0435\u0440\u0442\u043e\u043b\u0451\u0442 \u041a\u0435\u043b\u043b\u0435\u0442 \u041a\u041d-15, \u043e\u0441\u043d\u0430\u0449\u0451\u043d\u043d\u044b\u0439 \u043c\u0430\u043b\u0435\u043d\u044c\u043a\u0438\u043c\u0438 \u0436\u0438\u0434\u043a\u043e\u0441\u0442\u043d\u044b\u043c\u0438 \u0440\u0435\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u043c\u0438 \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043b\u044f\u043c\u0438, \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043d\u044b\u043c\u0438 \u043d\u0430 \u043a\u043e\u043d\u0446\u0430\u0445 \u043b\u043e\u043f\u0430\u0441\u0442\u0435\u0439 \u043d\u0435\u0441\u0443\u0449\u0435\u0433\u043e \u0432\u0438\u043d\u0442\u0430. \u041f\u0435\u0440\u0432\u044b\u0439, \u043f\u043e \u043c\u043d\u0435\u043d\u0438\u044e \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0445, \u043f\u0440\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0440\u0435\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0439 \u0432\u0438\u043d\u0442\u043e\u043a\u0440\u044b\u043b\u044b\u0439 \u043b\u0435\u0442\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0430\u043f\u043f\u0430\u0440\u0430\u0442, \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0438\u0439 \u043f\u043e\u043b\u0451\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1958_%D0%B3%D0%BE%D0%B4\" title=\"1958 \u0433\u043e\u0434\">1958<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C_%D0%90%D0%BB%D0%B6%D0%B8%D1%80%D0%B0\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0410\u043b\u0436\u0438\u0440\u0430\">\u0410\u043b\u0436\u0438\u0440\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430<\/a>: \u043d\u0430\u0447\u0430\u043b\u043e \u043c\u0430\u0439\u0441\u043a\u043e\u0433\u043e \u043f\u0443\u0442\u0447\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B6%D0%B8%D1%80\" title=\"\u0410\u043b\u0436\u0438\u0440\">\u0410\u043b\u0436\u0438\u0440\u0435<\/a>, \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u0432\u0448\u0435\u0433\u043e\u0441\u044f \u043f\u0430\u0434\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%82%D0%B2%D1%91%D1%80%D1%82%D0%B0%D1%8F_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0427\u0435\u0442\u0432\u0451\u0440\u0442\u0430\u044f \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0427\u0435\u0442\u0432\u0451\u0440\u0442\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0438<\/a> \u0432\u043e \u0424\u0440\u0430\u043d\u0446\u0438\u0438 \u0438 \u043f\u0440\u0438\u0445\u043e\u0434\u043e\u043c \u043a \u0432\u043b\u0430\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5_%D0%93%D0%BE%D0%BB%D0%BB%D1%8C,_%D0%A8%D0%B0%D1%80%D0%BB%D1%8C\" title=\"\u0414\u0435 \u0413\u043e\u043b\u043b\u044c, \u0428\u0430\u0440\u043b\u044c\">\u0428\u0430\u0440\u043b\u044f \u0434\u0435 \u0413\u043e\u043b\u043b\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1960_%D0%B3%D0%BE%D0%B4\" title=\"1960 \u0433\u043e\u0434\">1960<\/a>&#160;\u2014 \u0448\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u043a\u0438\u043c\u0438 \u0430\u043b\u044c\u043f\u0438\u043d\u0438\u0441\u0442\u0430\u043c\u0438 \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%AD%D0%B9%D0%B7%D0%B5%D0%BB%D0%B8%D0%BD,_%D0%9C%D0%B0%D0%BA%D1%81&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u042d\u0439\u0437\u0435\u043b\u0438\u043d, \u041c\u0430\u043a\u0441 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041c\u0430\u043a\u0441\u0430 \u042d\u0439\u0437\u0435\u043b\u0438\u043d\u0430<\/a> (Max Eiselin) \u043f\u043e\u043a\u043e\u0440\u0451\u043d \u0442\u0440\u0